// import React,{useState} from 'react';

export default function Todo(props){

     return (
         <li>
         <div className="todo">
            <form>
            <p htmlFor={props.id}>
               {props.name}
            </p>
            <input id={props.id}
                type="checkbox"
                defaultChecked={props.completed}
                onChange={() => props.toggleTaskCompleted(props.id)}
            />
            <label htmlFor="items"></label>
            </form>
         </div>
      </li>
    );
}
